  false,\n\t\"url\": null,\n\t\"notes\": \"The 2006 OSIP digital orthophotography
  was collected during the months of March and April (leaf-off conditions). The MrSID
  Images covering each county at 1-foot pixel resolution will be created at a 30:1
  compression ratio. At a 30:1 compression ratio, the resulting MrSID file size will
  average around 2GBs in size (dependent upon county size). MrSID Images will also
  be created for each buy-up county. These MrSIDs, will be compressed at a 20:1 ratio.
  In some cases, buy-up counties have requested a higher compression ratio. Hancock
  and Fairfield Counties have requested countywide ECW image files.\",\n\t\"license_title\":
